_type":"markdown","id":"caafe882","metadata":{"papermill":{"duration":0.207669,"end_time":"2022-02-27T20:17:34.884536","exception":false,"start_time":"2022-02-27T20:17:34.676867","status":"completed"},"tags":[]},"source":["Dado que el p-valor del contraste es superior a 0.05 no podemos rechazar la hipótesis nula, y por tanto podemos concluir que se verifica la hipótesis de homogeneidad o varianza constante."]},{"cell_type":"markdown","id":"f2637cb8","metadata":{"papermill":{"duration":0.206313,"end_time":"2022-02-27T20:17:35.296613","exception":false,"start_time":"2022-02-27T20:17:35.0903","status":"completed"},"tags":[]},"source":["***Verifica la hipótesis de homogeneidad de varainzas para los modelos de datos de papel y viscosidad.***"]},{"cell_type":"code","execution_count":17,"id":"57b5786c","metadata":{"execution":{"iopub.execute_input":"2022-02-27T20:17:35.714791Z","iopub.status.busy":"2022-02-27T20:17:35.713248Z","iopub.status.idle":"2022-02-27T20:17:35.72505Z","shell.execute_reply":"2022-02-27T20:17:35.723733Z"},"papermill":{"duration":0.222022,"end_time":"2022-02-27T20:17:35.725212","exception":false,"start_time":"2022-02-27T20:17:35.50319","status":"completed"},"tags":[]},"outputs":[],"source":["# Datos de papel"]},{"cell_type":"code","execution_count":18,"id":"c6439339","metadata":{"execution":{"iopub.execute_input":"2022-02-27T20:17:36.148679Z","iopub.status.busy":"2022-02-27T20:17:36.146825Z","iopub.status.idle":"2022-02-27T20:17:36.159576Z","shell.execute_reply":"2022-02-27T20:17:36.157947Z"},"papermill":{"duration":0.227352,"end_time":"2022-02-27T20:17:36.159722","exception":false,"start_time":"2022-02-27T20:17:35.93237","status":"completed"},"tags":[]},"outputs":[],"source":["# Datos de viscosidad"]},{"cell_type":"markdown","id":"a6af1c0e","metadata":{"papermill":{"duration":0.208008,"end_time":"2022-02-27T20:17:36.575713","exception":false,"start_time":"2022-02-27T20:17:36.367705","status":"completed"},"tags":[]},"source":["### Normalidad\n","\n","Para verificar la normalidad de los errores, disponemos de gráficos qq-plot de normalidad, en los que se representan los residuos ordenados $r_{[i]}$ (cuantiles empíricos) versus los cuantiles correspondientes a una normal estándar, $\\Phi^{-1}[(i-1)/n]$. Si es cierta la normalidad de los residuos, los puntos han de estar alineados con la diagonal. Desviaciones de la diagonal más o menos severas en las colas, e incluso en el centro de la distribución, dan indicios de desviaciones de normalidad. \n","La hipótesis de normalidad se puede chequear también con histogramas de los residuos cuando el tamaño muestral es grande.\n","\n","Los residuos estandarizados también son útiles para detectar desviaciones de la normalidad. Si los errores se distribuyen según una normal, entonces aproximadamente el $68\\%$ de los residuos estandarizados quedarán entre $-1$ y $+1$, y el $95\\%$ entre $-2$ y $+2$.\n","\n","Para diagnosticar la hipótesis de normalidad se utiliza el test de Shapiro-Wilks, donde rechazar la hipótesis nula implica el rechazo de la hipótesis de normalidad. Para realizar dicho contraste utilizamos la función `shapiro.test()`."]},{"cell_type":"code","execution_count":19,"id":"456838f0","metadata":{"execution":{"iopub.execute_input":"2022-02-27T20:17:36.996241Z","iopub.status.busy":"2022-02-27T20:17:36.993489Z","iopub.status.idle":"2022-02-27T20:17:37.211831Z","shell.execute_reply":"2022-02-27T20:17:37.210437Z"},"papermill":{"duration":0.431407,"end_time":"2022-02-27T20:17:37.211991","exception":false,"start_time":"2022-02-27T20:17:36.780584","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ3yT9eK/8e+dpIMWyt5bpsgSUUERVEgHpdCWVaYgIIIgoMhSfiCylY0gArKx\n7Ba60iCiHMCjIiCCzANSNpSW0p3kvv8Pev7oUaAFmn6T9Ho/8BXTkvsypu2HNEPRNE0AAADA\n+elkBwAAACB/MOwAAABcBMMOAADARTDsAAAAXATDDgAAwEUw7AAAAFwEww4AAMBFMOwAAABc\nhEF2QC5SUlL69Okju8IhqKqqKIqiKLJDHJ2maTkvu63T8feW3KmqyhWVF6qqCiH4GsyLn