nd_time":"2022-02-27T20:17:38.489206","exception":false,"start_time":"2022-02-27T20:17:38.279689","status":"completed"},"tags":[]},"source":["Dado que el p-valor del contraste es superior a 0.05 no podemos rechazar la hipótesis nula, y por tanto podemos considerar que los residuos se distribuyen normalmente."]},{"cell_type":"markdown","id":"ede918b1","metadata":{"papermill":{"duration":0.207177,"end_time":"2022-02-27T20:17:38.904027","exception":false,"start_time":"2022-02-27T20:17:38.69685","status":"completed"},"tags":[]},"source":["***Analiza la hipótesis de normalidad para los modelos de los datos de papel y viscosidad***"]},{"cell_type":"markdown","id":"a7e099c6","metadata":{"papermill":{"duration":0.207779,"end_time":"2022-02-27T20:17:39.320143","exception":false,"start_time":"2022-02-27T20:17:39.112364","status":"completed"},"tags":[]},"source":["### Independencia. \n","\n","La correlación entre los datos es un proceso intrínseco al muestreo; saber cómo se ha llevado a cabo éste da información, generalmente suficiente, para poder hablar de correlación o incorrelación. En todo caso, los gráficos secuenciales de residuos sirven para detectar problemas de correlación de éstos (*autocorrelación*), o de inestabilidad de la varianza a lo largo del tiempo. También son útiles para esto los gráficos en que se representa un residuo versus el anterior en la secuencia en que han sido observados; si hay correlación se apreciará tendencia. Detectar autocorrelación llevará a considerar otro tipo de modelos distintos (autocorrelados: modelos de series temporales). \n","\n","Aparte de los métodos gráficos, para resolver dicho contraste se utiliza el test de Durbin-Watson, cuya función es `dwtest()`. Rechazar la hipótesis nula implica el rechazo de la hipótesis de incorrelación."]},{"cell_type":"code","execution_count":21,"id":"c85a49e1","metadata":{"execution":{"iopub.execute_input":"2022-02-27T20:17:39.744998Z","iopub.status.busy":"2022-02-27T20:17:39.74435Z","iopub.status.i