amos los gráficos de diagnóstico para corroborar este hecho."]},{"cell_type":"code","execution_count":24,"id":"3d600718","metadata":{"execution":{"iopub.execute_input":"2022-02-27T20:17:44.976895Z","iopub.status.busy":"2022-02-27T20:17:44.975517Z","iopub.status.idle":"2022-02-27T20:17:45.146987Z","shell.execute_reply":"2022-02-27T20:17:45.145896Z"},"papermill":{"duration":0.39103,"end_time":"2022-02-27T20:17:45.147124","exception":false,"start_time":"2022-02-27T20:17:44.756094","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeZzVdaH/8c85ZxZg2ARxQXADQWVJBTLD1Nxyt1xKzSVz65YaaWaoN0lbXHLX\nMsMlzdR7K03NpetSrvUTV5BMw0DUUNYZGGY5c875/TE2EssMAzPzPeczz+cfPobvgeHdfBt4\n8T1bqlAoBAAASl866QEAAHQMYQcAEAlhBwAQCWEHABAJYQcAEAlhBwAQCWEHABAJYQcAEImy\npAe0Q1NTUzabDSFUVlam0909SZtfWTqVSiU9hNa0vAC4M1XkCoWCc1T8/LlXKnxDJaiUwm76\n9Om///3vQwinnnrq4MGDk56TsJqamrKysqqqqqSH0JqFCxeGEHr27OlMFbmFCxf27du3oqIi\n6SGsUWNjY01NTQjBmSpy2Wy2urp64MCB2i4R3f26FwBANIQdAEAkhB0AQCSEHQBAJIQdAEAk\nhB0AQCSEHQBAJIQdAEAkhB0AQCSEHQBAJIQdAEAkhB0AQCTKkh6wLurq6mpra5NekbBcLlco\nFHwdSkI2m3Wmil99fX02m016BWuUy+WaP3Cmilw+nw8h1NbWplKppLfEqaqqqpVbSzLscrlc\nU1NT0isSVigU8vm8r0NJcKZKQvM/lpJewRo150LzB85UMWs+Oy0hTocrFAqtRHNJhl3v3r37\n9euX9IqEVVdXl5WVtZ7tJG7BggUhhMrKSmeqyC1YsKCqqqqioiLpIaxRY2NjTU1NCKFXr17O\nVDHLZrPV1dV9+/Z1xS4RHmMHABAJYQcAEAlhBwAQCWEHABAJYQcAEAlhBwAQCWEHABAJYQcA\nEAlhBwAQCWEHABAJYQcAEAlhBwAQCWEHABAJYQcAEImypAcAsO7efvvt++677+233958880P\nOuig7bffPulFQJKEHUCp+tGPfjRlypRsNptKpQqFwnnnnfetb33rsssuS6VSSU8DkuGuWICS\ndPfdd59//vnZbDaEUCgUQgi5XO4nP/nJ9ddfn/Q0IDHCDqAkXX311en0yn+Gp1KpK6+8MpE9\nQDEQdgAl6dVXX83n8ysdLBQKs2fPXrp0aSKTgMQJO4CSVFa2xgdJt3ITEDdhB1CSPvWpT616\nV2w6nR4zZkzPnj0TmQQkTtgBlKTzzz8/hLBi26XT6Xw+f+GFFyY3CkiYsAMoSXvsscf//u//\nDho0qOVIv379brnllsMPPzzBVUCyPA4DoFQddthh++677zPPPPPWW29ttdVWu+66a//+/ZMe\nBSRJ2AGUsN69e++333777bdf0kOAouCuWACASAg7AIBICDsAgEgIOwCASAg7AIBICDsAgEgI\nOwCASAg7AIBICDsAgEgIOwCASAg7AIBICDsAgEgIOwCAS